import React from 'react'
import { useNavigate } from 'react-router-dom'
import { styled } from '@mui/material/styles';
import Button from '@mui/material/Button';
import { pink } from '@mui/material/colors';
import "./outlet.css"

const Outlet = () => {
  const navigate = useNavigate()

  const selectScooty = (area)=>{
    localStorage.setItem("outletarea",area)
    navigate("/vehicle")
  }

  const ColorButton = styled(Button)(({ theme }) => ({
    color: theme.palette.getContrastText(pink[700]),
    backgroundColor: pink[700],
    '&:hover': {
      backgroundColor: pink[700],
    },
  }));

  return (
    <div>
        <h3>Select your area</h3>
        <div className='main'>
            <div id="box1" onClick={()=>selectScooty("BTM")}><ColorButton id="btn" size="large" variant="contained">BTM</ColorButton></div>
            <div id="box2" onClick={()=>selectScooty("IndraNagar")}><ColorButton id="btn" size="large" variant="contained">IndraNagar</ColorButton></div>
            <div id="box3" onClick={()=>selectScooty("Rajaji Nagar")}>Rajaji Nagar</div>
            <div id="box4" onClick={()=>selectScooty("HSR Layout")}>HSR Layout</div>
            <div id="box5" onClick={()=>selectScooty("Koramangala")}>Koramangala</div>
            <div id="box6" onClick={()=>selectScooty("Maruthi Layout")}>Maruthi Layout</div>
        </div>
    </div>
  )
}

export default Outlet
